import logo from './cappslogo.jpg';
import './App.css';
import Form from'./Form.js';
import { Dropdown } from './Dropdown.js'
import { DropdownElement } from './DropdownElement.js'


function App() {
  return (
    <div className="App" id="header">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to the CAPPS bolt configurator app!
        </p>
      </header>
      <div className="Configurator">
        <DropdownElement className="dropdown-input" label="Length:   " array={[100,110,120,130,140,150,160,170,180,190,200,210,220,230,240,250,260,270,280,290,300,310,320,330,340,350,360,370,380,390,400]}/>
        <DropdownElement className="dropdown-input" label="Diameter:   " array={[15,32,40,55]}/>
        <DropdownElement className="dropdown-input" label="Pitch:   " array={[5,10,15]} />
        <DropdownElement className="dropdown-input" label="Nut Type:   " array={["Copper","Steel"]}/>
      </div>
    </div>
  );
}

export default App;
